import * as React from "react";
import Container from "@mui/material/Container";
import {
  Avatar,
  Box,
  Button,
  Checkbox,
  FormControlLabel,
  Grid,
  TextField,
  Typography,
} from "@mui/material";
import { Link } from "react-router-dom";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import { loginSchema } from "../validations/loginValidation";

export default function SignIn() {
  type LoginType = {
    email: string;
    password: string;
  };

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm<LoginType>({ resolver: yupResolver(loginSchema) });

  const onSubmit = async (values: LoginType, e: any) => {
    e.target.reset();
    console.log(values);

    const url = "https://localhost:7063/api/register";
    const data = {
      email: values.email,
      password: values.password,
    };

    try {
      const response = await fetch(url, {
        method: "POST",
        body: JSON.stringify(data),
        headers: {
          "Content-Type": "application/json",
        },
      });
      const json = (await response).json();
      console.log("Succes:", JSON.stringify(json));
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <Container component="main" maxWidth="xs">
      <Box
        sx={{
          marginTop: 8,
          marginBottom: 8,
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <Avatar sx={{ m: 1, bgcolor: "primary.main" }}></Avatar>
        <Typography component="h1" variant="h5" sx={{ fontWeight: "bold" }}>
          Sign in{" "}
        </Typography>
        <Box
          component="form"
          onSubmit={handleSubmit(onSubmit)}
          noValidate
          sx={{ mt: 1 }}
        >
          <Grid item xs={12}>
            <TextField margin="normal" fullWidth label="Email Address" />
            {errors.email && (
              <Typography style={{ color: "#F95252" }}>
                * {errors.email.message}
              </Typography>
            )}
          </Grid>
          <Grid item xs={12}>
            <TextField
              margin="normal"
              fullWidth
              label="Password"
              type="password"
            />
            {errors.email && (
              <Typography style={{ color: "#F95252" }}>
                * {errors.email.message}
              </Typography>
            )}
          </Grid>

          <FormControlLabel
            control={<Checkbox value="remember" color="primary" />}
            label="Remember me"
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2 }}
          >
            {" "}
            Sign In{" "}
          </Button>

          <Grid container>
            <Grid item>
              <Link to={"/signup"}> {"Don't have an account? Sign Up"} </Link>
            </Grid>
          </Grid>
        </Box>
      </Box>
    </Container>
  );
}
